import "./footer.css";

function Footer() {
  return (
    <footer className="footer">
        <div class="container">
            <div class="flex">
                <div class="copyright-spacer"></div>
                <p class="copyright">
                    Copyright &copy; SDSU Mechatronics 2022
                </p>
            </div>
        </div>
    </footer>
  );
}

export default Footer;
